import React from 'react';

const UserCard = (props) => {
    console.log('rendering user...')
    return (
        <div>
            {props.user.map(user =>(
                <div key={user.login} className='user'>
                    <img src={user.avatar_url} alt={user.data.name}/>
                    <div>
                        <h2>{user.name}</h2>
                        <h2>{user.login}</h2>
                        <h3>Location: {user.location}</h3>
                        <h3>Profile:</h3>
                    </div>

                </div>
            ))}
        </div>
    )

}

export default UserCard;
